import React, { useEffect, useState } from 'react'
import { reportTitleList } from '../../utils/utils';

function ComplaintInfo({ complaintInfo }) {


    const [titleObject, setTitleObject] = useState({});
    const month = ((new Date).getMonth() + 1);

    useEffect(() => {

        const title = reportTitleList.find(title => { return title.value === complaintInfo.Title });
        setTitleObject(title);

        return () => {
            setTitleObject({});
        }
    }, [complaintInfo])


    return (
        <table class="table">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">First</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th scope="row">1</th>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
    <tr>
      <th scope="row">2</th>
      <td>Jacob</td>
      <td>Thornton</td>
      <td>@fat</td>
    </tr>
    <tr>
      <th scope="row">3</th>
      <td colspan="2">Larry the Bird</td>
      <td>@twitter</td>
    </tr>
  </tbody>
</table>
    )
}

export default ComplaintInfo
